description:
At a time when interracial love was forbidden, their passion couldn't be tamed!
Well-to-do Rayveness falls on hard times when her husband passes away, so she sends her kids Dane and Sammy to stay with the family of her former housekeeper. The arrival of the gorgeous, young siblings opens a Pandora's Box of secrets between the white and black families. Sean Michaels struggles to keep the truth hidden, while battling his own passionate longing for Rayveness.

